import CustomNavBar from '../components/Navbar';
import React, { useEffect, useState, useContext } from 'react';
import { checkAuthenticated } from '../actions/auth';
import { connect } from 'react-redux';
import { load_user } from '../actions/profile';
import { Navigate } from 'react-router-dom';
import CSRFToken from '../components/CSRFToken';
import { UserContext } from '../UserContext';



const Dashboard = ({ checkAuthenticated, load_user, isAuthenticated }) => {
    
    useEffect(() => {
        checkAuthenticated();
        load_user();
    }, []);
    const username = user ? user.username : 'Brak zalogowanego użytkownika';
    const { user, setUser } = useContext(UserContext);

    
    

    
    const onSubmit = async e => {
        e.preventDefault();
        

        await setUser({ ...user});

    };

    
    

    return isAuthenticated ? (
        <div className='container mt-5'>
            <CustomNavBar />
            <CSRFToken />
            <h1>Jesteś zalogowany jako: {username}</h1>
            
            
        </div>
    ) : (
        <Navigate to="/login" />
    );
};

const mapStateToProps = state => ({
    isAuthenticated: state.auth.isAuthenticated
});

export default connect(mapStateToProps, { checkAuthenticated, load_user })(Dashboard);



Dashboard.contextType = UserContext;
